create table pemeriksaan (
	id INT NOT NULL PRIMARY KEY,
	waktu_pemeriksaan DATE,
	id_pasien INT,
	id_dokter INT,
	no_telp_pasien VARCHAR2(50),
	no_telp_dokter VARCHAR2(50),
	CONSTRAINT FK_IdPasien FOREIGN KEY (id_pasien)
    REFERENCES pasien(id_pasien) ON DELETE CASCADE,
	CONSTRAINT FK_IdDokter FOREIGN KEY (id_dokter)
    REFERENCES dokter(id_dokter) ON DELETE CASCADE
);

